import LogoNav from "../Navbars/logo-nav";
import {Link} from 'react-router-dom'
function Tech(props){
    return(
        <>
            <LogoNav />
            <h1>Tech page</h1>
            {props.data.map((items)=>(
                <div>
                    <h1>{items.title}</h1>
                    <p>{items.content}</p>
                    <Link to={`tech/${items.title}`} >Know more</Link>
                </div>
            ))}
        </>
    )
}

export default Tech;
